import{_ as o,a as e}from"./chunks/botao_area_de_transferencia_tc.DGtQnXJd.js";import{b as i,a as r,h as d,_ as t,c,d as l,e as n,f as m,g as p,i as u,j as h,k as b,l as f,m as A}from"./chunks/botao_menu.CDnsO4ly.js";import{_ as v}from"./chunks/salvar_abrir_novo.Cw6eah7w.js";import{_ as q,c as g,o as x,ae as s,j as C}from"./chunks/framework.bdwBUuqg.js";const P="/docs/assets/tela_principal_tc.DmXJIUaT.png",R="data:image/png;base64,",I="/docs/assets/importa_arrasta.BLP-GDMS.gif",B="/docs/assets/erro_dado_obrigatorio.DrEZUnpB.png",N="/docs/assets/adicionar_periodo.CzeMT4I3.png",k="data:image/png;base64,",S="data:image/png;base64,",E="data:image/png;base64,",D="/docs/assets/adicionar_periodo_pcd.Dpnux_Bg.png",z="/docs/assets/janela_detalhes_do_beneficio_a_computar.Bk3zIy73.png",T="/docs/assets/janela_editar_beneficio_a_computar.fbsepF4O.png",j="/docs/assets/beneficio_derivado_como_salario.lld_eymK.png",M="/docs/assets/demonstrativo_informacoes_parametros.5QImtNPJ.png",Q="/docs/assets/periodos_calculados.BF7daPxS.png",U="/docs/assets/exemplo_periodo_pcd.BgPlMbv_.png",O="/docs/assets/legenda_deficiente.BWV98tHs.png",F="/docs/assets/requisitos_cumpridos.C5snvQDi.png",y="/docs/assets/requisitos_nao_cumpridos.CF4NuZzr.png",H="/docs/assets/analise_reafirmacao_der.CgwQ7XJF.png",X="data:image/png;base64,",w="/docs/assets/demonstrativo_rmi_dados.BVQ7iZH2.png",Z="data:image/png;base64,",L="/docs/assets/menu_contextual_tabela_demonstrativo.DQ8mgzUY.png",V="data:image/png;base64,",Y="/docs/assets/novo_gerar_texto_periodo.DYtc0XI_.png",G="/docs/assets/novo_gerar_texto_beneficios.BNZ9iOsf.png",J="data:image/png;base64,",ta=JSON.parse('{"title":"Cálculo de Benefícios (TC e RMI) - Introdução","description":"","frontmatter":{"outline":"deep"},"headers":[],"relativePath":"tc.md","filePath":"tc.md","lastUpdated":1754507746000}'),K={name:"tc.md"};function W(_,a,$,aa,oa,ea){return x(),g("div",null,a[0]||(a[0]=[s('<h1 id="calculo-de-beneficios-tc-e-rmi-introducao" tabindex="-1">Cálculo de Benefícios (TC e RMI) - Introdução <a class="header-anchor" href="#calculo-de-beneficios-tc-e-rmi-introducao" aria-label="Permalink to &quot;Cálculo de Benefícios (TC e RMI) - Introdução&quot;">​</a></h1><p>A análise dos benefícios previdenciários do Regime Geral da Previdência Social envolve apuração do <strong>Tempo de Contribuição</strong> (utilizado para verificação do cumprimento dos requisitos para concessão) e da <strong>Renda Mensal Inicial (RMI)</strong> (valor base que será pago ao beneficiário).</p><p>A ferramenta <a href="https://www.trf3.jus.br/cecalc/tc/" target="_blank" rel="noreferrer"><strong>Cálculo de Benefícios</strong></a> realiza o cálculo do tempo de contribuição, ajustado às variáveis aplicáveis aos diversos casos, e verifica o cumprimento dos requisitos dos benefícios previdenciários do Regime Geral de Previdência Social, incluídas as regras de transição da Emenda Constitucional nº 103/2019 e direito adquirido em regras anteriores. A ferramenta também efetua o cálculo da Renda Mensal Inicial (RMI), observada a regra de descartes, para todos os benefícios com requisitos cumpridos e destaca o valor mais vantajoso.</p><h2 id="video-de-divulgacao" tabindex="-1">Vídeo de divulgação: <a class="header-anchor" href="#video-de-divulgacao" aria-label="Permalink to &quot;Vídeo de divulgação:&quot;">​</a></h2>',4),C("iframe",{width:"750",height:"450",src:"https://www.youtube.com/embed/ri2doL2xT6E",title:"Fabrica de Calculos TRF3 - Apresentacao 11",frameborder:"0",allow:"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share",referrerpolicy:"strict-origin-when-cross-origin",allowfullscreen:""},null,-1),s('<h2 id="acesso-ao-aplicativo-de-calculo" tabindex="-1">Acesso ao aplicativo de cálculo <a class="header-anchor" href="#acesso-ao-aplicativo-de-calculo" aria-label="Permalink to &quot;Acesso ao aplicativo de cálculo&quot;">​</a></h2><p>O aplicativo de cálculo de tempo de contribuição está disponível no link: <strong><a href="https://www.trf3.jus.br/cecalc/tc/" target="_blank" rel="noreferrer">https://www.trf3.jus.br/cecalc/tc/</a></strong></p><h2 id="ultimas-atualizacoes" tabindex="-1">Últimas Atualizações <a class="header-anchor" href="#ultimas-atualizacoes" aria-label="Permalink to &quot;Últimas Atualizações&quot;">​</a></h2><h3 id="versao-6-0-10-lancada-em-22-11-2024" tabindex="-1">Versão 6.0.10 lançada em 22/11/2024 <a class="header-anchor" href="#versao-6-0-10-lancada-em-22-11-2024" aria-label="Permalink to &quot;Versão 6.0.10 lançada em 22/11/2024&quot;">​</a></h3><p>Novidades:</p><ul><li>alterada forma de inserção dos benefícios.</li></ul><details><h3 id="versao-4-12-0-lancada-em-01-10-2024" tabindex="-1">Versão 4.12.0 lançada em 01/10/2024 <a class="header-anchor" href="#versao-4-12-0-lancada-em-01-10-2024" aria-label="Permalink to &quot;Versão 4.12.0 lançada em 01/10/2024&quot;">​</a></h3><p>Novidades:</p><ul><li>implementada importação do demonstrativo de cálculo da RMI do SIBE.</li></ul><h3 id="versao-4-11-0-lancada-em-22-08-2024" tabindex="-1">Versão 4.11.0 lançada em 22/08/2024 <a class="header-anchor" href="#versao-4-11-0-lancada-em-22-08-2024" aria-label="Permalink to &quot;Versão 4.11.0 lançada em 22/08/2024&quot;">​</a></h3><p>Novidades:</p><ul><li>implementada opção para cálculo da aposentadoria PCD com base nos 80% maiores salários mesmo após a EC103/19;</li><li>Implementada opção de auxílio-acidente (comportamento diferenciado) na evolução de Benefícios na aba Salários;</li><li>implementada busca por competência na aba Salários;</li><li>implementadas diversas informações no Demonstrativo (indexadores, moedas, observações dos salários);</li><li>Implementada opção para aplicar ou não o IRSM de fevereiro/94.</li></ul><h3 id="versao-4-9-3-lancada-em-16-08-2024" tabindex="-1">Versão 4.9.3 lançada em 16/08/2024 <a class="header-anchor" href="#versao-4-9-3-lancada-em-16-08-2024" aria-label="Permalink to &quot;Versão 4.9.3 lançada em 16/08/2024&quot;">​</a></h3><p>Novidades:</p><ul><li>exclusão automática de períodos com salário inferior ao mínimo após a Emenda Constitucional nº 103/2019;</li><li>implementado o cálculo da RMI, inclusive pela &quot;regra do descarte&quot; (art. 26, §6º da Emenda Constitucional nº 103/2019).</li></ul><h3 id="versao-2-0-0-lancada-em-27-05-2024" tabindex="-1">Versão 2.0.0 lançada em 27/05/2024 <a class="header-anchor" href="#versao-2-0-0-lancada-em-27-05-2024" aria-label="Permalink to &quot;Versão 2.0.0 lançada em 27/05/2024&quot;">​</a></h3><p>Novidades:</p><ul><li>digitação simplificada das datas na planilha dos períodos;</li><li>botão para recorte de períodos;</li><li>opção para cômputo proporcional de períodos após a Emenda Constitucional nº 103/2019;</li><li>alteração dos dados mediante clique fora da célula;</li><li>novas opções de configuração dos demonstrativos;</li><li>botão de reafirmação da DER;</li><li>extração da Contagem do INSS (apenas com texto copiável);</li><li>conversão de resultados em textos;</li><li>correção de bugs.</li></ul></details><h2 id="interface" tabindex="-1">Interface <a class="header-anchor" href="#interface" aria-label="Permalink to &quot;Interface&quot;">​</a></h2><p>A página inicial apresenta a seguinte interface: <img src="'+P+'" alt="Tela principal"></p><hr><h2 id="funcionalidades" tabindex="-1">Funcionalidades <a class="header-anchor" href="#funcionalidades" aria-label="Permalink to &quot;Funcionalidades&quot;">​</a></h2><p>A ferramenta apresenta as seguintes funcionalidades (clique nos links para ver os vídeos diretamente no <strong><em>YouTube</em></strong>):</p><ul><li>extração e importação de dados (extrato CNIS - Relações Previdenciárias e Remunerações, contagem do INSS, carta de concessão do benefício, outras planilhas em Excel / Planilhas Google, entre outros);</li><li><a href="https://youtu.be/VP5oB0dVpvA" target="_blank" rel="noreferrer">exclusão automática de períodos concomitantes</a>;</li><li>reordenação automática dos períodos em ordem cronológica;</li><li>conversão de períodos (especiais e da pessoa com deficiência);</li><li>apuração de carência (artigo 24 da Lei 8.213/91);</li><li><a href="https://youtu.be/nVRQegBndOM" target="_blank" rel="noreferrer">análise de requisitos para concessão de benefícios (inclusive direito adquirido)</a>;</li><li><a href="https://youtu.be/j2QB9ZE_q4I" target="_blank" rel="noreferrer">análise da reafirmação da DER (Tema 995/STJ) com definição da data exata da implementação dos requisitos</a>;</li><li>exportação dos resultados obtidos em texto, imagem, CSV ou PDF;</li><li><a href="https://youtu.be/cP3Msz6MQOQ" target="_blank" rel="noreferrer">cálculo da aposentadoria da pessoa com deficência (Lei Complementar nº 142/2013)</a>;</li><li><a href="https://youtu.be/y0WDsMTHCw0" target="_blank" rel="noreferrer">cálculo da Renda Mensal Inicial (RMI) com descartes (art. 26, §6º da Emenda Constitucional nº 103/2019) e destaque do valor mais vantajoso</a>.</li></ul><h2 id="importacao-da-contagem-do-inss" tabindex="-1">Importação da contagem do INSS ⚡ ⚡ <a class="header-anchor" href="#importacao-da-contagem-do-inss" aria-label="Permalink to &quot;Importação da contagem do INSS :zap: :zap:&quot;">​</a></h2><p>A ferramenta apresenta a funcionalidade de importação dos dados constantes nas <code>contagens do INSS</code>. Importante salientar que os arquivos devem estar em formato PDF com dados passíveis de serem copiados.</p><div class="tip custom-block"><p class="custom-block-title">💡 DICA</p><p><strong><a href="https://www.gov.br/pt-br/servicos/solicitar-copia-de-processo-no-inss" target="_blank" rel="noreferrer">Link para informações sobre como obter a cópia do processo administrativo que pode conter a contagem do INSS</a></strong></p></div><h3 id="copiando-conteudo-dos-arquivos-com-o-botao-caixa-de-texto" tabindex="-1">Copiando conteúdo dos arquivos com o botão <code>Caixa de Texto</code> <a class="header-anchor" href="#copiando-conteudo-dos-arquivos-com-o-botao-caixa-de-texto" aria-label="Permalink to &quot;Copiando conteúdo dos arquivos com o botão `Caixa de Texto`&quot;">​</a></h3><p><img src="'+o+'" alt="Botão caixa de texto"> Passos para realizar o procedimento:</p><blockquote><ul><li>os dados devem ser selecionados e copiados de um arquivo válido;</li><li>clicar no botão <code>Caixa de Texto</code>;</li><li>clicar na área de transferência e colar os dados.</li></ul></blockquote><h3 id="copiando-conteudo-dos-arquivos-com-o-botao-area-de-transferencia" tabindex="-1">Copiando conteúdo dos arquivos com o botão <code>Área de Transferência</code> <a class="header-anchor" href="#copiando-conteudo-dos-arquivos-com-o-botao-area-de-transferencia" aria-label="Permalink to &quot;Copiando conteúdo dos arquivos com o botão `Área de Transferência`&quot;">​</a></h3><p><img src="'+e+'" alt="Botão area de transferência"> Passos para realizar o procedimento:</p><blockquote><ul><li>os dados devem ser selecionados e copiados de um arquivo válido;</li><li>clicar no botão <code>Área de Transferência</code>.</li></ul></blockquote><h2 id="importacao-do-extrato-cnis-relacoes-previdenciarias-e-remuneracoes-e-dados-de-outras-planilhas" tabindex="-1">Importação do extrato CNIS (Relações Previdenciárias e Remunerações) e dados de outras planilhas ⚡ <a class="header-anchor" href="#importacao-do-extrato-cnis-relacoes-previdenciarias-e-remuneracoes-e-dados-de-outras-planilhas" aria-label="Permalink to &quot;Importação do extrato CNIS (Relações Previdenciárias e Remunerações) e dados de outras planilhas :zap:&quot;">​</a></h2><p>A ferramenta apresenta a funcionalidade de importação dos dados constantes no <code>extrato CNIS (Relações Previdenciárias e Remunerações)</code> e de dados de outras planilhas: <img src="'+R+'" alt="Importar dados"></p><div class="warning custom-block"><p class="custom-block-title">❗ IMPORTANTE</p><p><strong>O <code>extrato CNIS (Relações Previdenciárias e Remunerações)</code> pode ser obtido no site do <a href="https://meu.inss.gov.br" target="_blank" rel="noreferrer">Meu INSS</a></strong></p></div><div class="tip custom-block"><p class="custom-block-title">💡 DICA</p><p><strong><a href="https://www.gov.br/pt-br/servicos/emitir-extrato-de-contribuicao-cnis" target="_blank" rel="noreferrer">Link para informações sobre extrato CNIS (Relações Previdenciárias e Remunerações)</a></strong></p></div><p>Existem <strong>3</strong> métodos disponíveis para realizar a importação dos dados:</p><blockquote><ul><li><a href="/docs/tc.html#arrastando-arquivos-do-computador">&quot;arrastar&quot; os arquivos do computador</a>;</li><li><a href="/docs/tc.html#copiando-conteudo-dos-arquivos-com-o-botao-caixa-de-texto">copiar o conteúdo dos arquivos e utilizar o botão <code>Caixa de Texto</code></a>;</li><li><a href="/docs/tc.html#copiando-conteudo-dos-arquivos-com-o-botao-area-de-transferencia">copiar o conteúdo dos arquivos e utilizar o botão <code>Área de Transferência</code></a>.</li></ul></blockquote><h3 id="arrastar-arquivos-do-computador" tabindex="-1">&quot;Arrastar&quot; arquivos do computador <a class="header-anchor" href="#arrastar-arquivos-do-computador" aria-label="Permalink to &quot;&quot;Arrastar&quot; arquivos do computador&quot;">​</a></h3><p>Para realizar este procedimento, basta clicar com o mouse no arquivo gravado no computador e &quot;arrastá-lo&quot; para o quadro respectivo. <img src="'+I+'" alt="Botão caixa de texto" width="70%"></p><h3 id="copiando-conteudo-dos-arquivos-com-o-botao-caixa-de-texto-1" tabindex="-1">Copiando conteúdo dos arquivos com o botão <code>Caixa de Texto</code> <a class="header-anchor" href="#copiando-conteudo-dos-arquivos-com-o-botao-caixa-de-texto-1" aria-label="Permalink to &quot;Copiando conteúdo dos arquivos com o botão `Caixa de Texto`&quot;">​</a></h3><p><img src="'+o+'" alt="Botão caixa de texto"> Passos para realizar o procedimento:</p><blockquote><ul><li>os dados devem ser selecionados e copiados de um arquivo válido;</li><li>clicar no botão <code>Caixa de Texto</code>;</li><li>clicar na área de transferência e colar os dados.</li></ul></blockquote><h3 id="copiando-conteudo-dos-arquivos-com-o-botao-area-de-transferencia-1" tabindex="-1">Copiando conteúdo dos arquivos com o botão <code>Área de Transferência</code> <a class="header-anchor" href="#copiando-conteudo-dos-arquivos-com-o-botao-area-de-transferencia-1" aria-label="Permalink to &quot;Copiando conteúdo dos arquivos com o botão `Área de Transferência`&quot;">​</a></h3><p><img src="'+e+'" alt="Botão area de transferência"> Passos para realizar o procedimento:</p><blockquote><ul><li>os dados devem ser selecionados e copiados de um arquivo válido;</li><li>clicar no botão <code>Área de Transferência</code>.</li></ul></blockquote><h2 id="aba-parametros" tabindex="-1">Aba Parâmetros <a class="header-anchor" href="#aba-parametros" aria-label="Permalink to &quot;Aba Parâmetros&quot;">​</a></h2><p>Na aba <code>Parâmetros</code> devem ser informados alguns dados para que o cálculo possa ser executado. Os dados são separados nas seguintes subabas:</p><ol><li><a href="./tc.html#geral">Geral</a></li><li><a href="./tc.html#tempo">Tempo</a></li><li><a href="./tc.html#rmi">RMI</a></li></ol><h3 id="geral" tabindex="-1">Geral <a class="header-anchor" href="#geral" aria-label="Permalink to &quot;Geral&quot;">​</a></h3><p>Na subaba <code>Geral</code>, temos os seguintes blocos:</p><ol><li><a href="/docs/tc.html#identificacao-do-calculo-e-do-processo">Identificação do Cálculo e do Processo</a></li><li><a href="/docs/tc.html#dados-basicos-do-segurado-e-do-beneficio">Dados Básicos do Segurado e do Benefício</a></li></ol><h4 id="identificacao-do-calculo-e-do-processo" tabindex="-1">Identificação do Cálculo e do Processo <a class="header-anchor" href="#identificacao-do-calculo-e-do-processo" aria-label="Permalink to &quot;Identificação do Cálculo e do Processo&quot;">​</a></h4><p>Aqui podem ser inseridas informações opcionais referentes ao processo judicial: número do <code>Processo</code> e nome do <code>Autor</code>. Também é possível definir um <code>Nome do Cálculo</code>.</p><h5 id="nome-do-calculo" tabindex="-1">Nome do Cálculo <a class="header-anchor" href="#nome-do-calculo" aria-label="Permalink to &quot;Nome do Cálculo&quot;">​</a></h5><p>Utilizado para definir um nome que será exibido no demonstrativo no canto superior direito, caso seja definido no menu <a href="/docs/tc.html#botao-configuracoes">Configurações</a> essa opção em <a href="/docs/tc.html#tipo-de-cabecalho">Tipo de Cabeçalho</a>. Caso seja informado, será utilizado como nome dos arquivos de cálculo salvos (.calc).</p><h5 id="processo" tabindex="-1">Processo <a class="header-anchor" href="#processo" aria-label="Permalink to &quot;Processo&quot;">​</a></h5><p>Utilizado para definir o número do processo e será exibido no canto superior direito do demonstrativo, caso seja definido no menu <a href="/docs/tc.html#botao-configuracoes">Configurações</a> a opção <code>Dados do Processo</code> em <a href="/docs/tc.html#tipo-de-cabecalho">Tipo de Cabeçalho</a>. O número será validado conforme regras do CNJ e não será utilizado caso seja inválido. Caso seja informado, será utilizado como nome dos arquivos de cálculo salvos (.calc), desde que não seja informado um <code>Nome do Cálculo</code>.</p><h6 id="autor" tabindex="-1">Autor <a class="header-anchor" href="#autor" aria-label="Permalink to &quot;Autor&quot;">​</a></h6><p>Utilizado para definir o nome da parte autora e será exibido no demonstrativo no canto superior direito, caso seja definido no menu <a href="/docs/tc.html#botao-configuracoes">Configurações</a> a opção <code>Dados do Processo</code> em <a href="/docs/tc.html#tipo-de-cabecalho">Tipo de Cabeçalho</a>. Caso seja informado, será utilizado como nome dos arquivos de cálculo salvos (.calc), desde que não sejam informados <code>Nome do Cálculo</code> e <code>Processo</code>.</p><h4 id="dados-basicos-do-segurado-e-do-beneficio" tabindex="-1">Dados Básicos do Segurado e do Benefício <a class="header-anchor" href="#dados-basicos-do-segurado-e-do-beneficio" aria-label="Permalink to &quot;Dados Básicos do Segurado e do Benefício&quot;">​</a></h4><p>Existem 4 (quatro) campos de preenchimento obrigatório: <a href="/docs/tc.html#sexo">Sexo</a>, <a href="/docs/tc.html#nascimento">Nascimento</a>, <a href="/docs/tc.html#der">DER (data de entrada do requerimento)</a> e <a href="/docs/tc.html#especie">Espécie</a>.</p><p>Caso algum dado obrigatório não seja informado, será exibida no demonstrativo a seguinte mensagem: <img src="'+B+'" alt="Erro: falta dado obrigatório"></p><p>Além disso, o tipo de benefício padrão é definido como <code>Comum</code>, podendo ser alterado para Pessoa com Deficiência (<code>PCD</code>) ou <code>Rurícola</code> (este últmo, apenas para a espécie <code>41 - Aposentadoria por idade</code>). Os campos <code>NB</code> (número de benefício) e <code>DER Reafirmada</code> são opcionais.</p><h5 id="sexo" tabindex="-1">Sexo <a class="header-anchor" href="#sexo" aria-label="Permalink to &quot;Sexo&quot;">​</a></h5><p>Campo obrigatório. Inserção necessária para correta apuração dos requisitos a serem cumpridos, bem como aplicação dos fatores de conversão adequados.</p><h5 id="nascimento" tabindex="-1">Nascimento <a class="header-anchor" href="#nascimento" aria-label="Permalink to &quot;Nascimento&quot;">​</a></h5><p>Campo obrigatório. Inserção necessária para verificação de requisitos e apuração do fator previdenciário (se o caso).</p><h5 id="tipo" tabindex="-1">Tipo <a class="header-anchor" href="#tipo" aria-label="Permalink to &quot;Tipo&quot;">​</a></h5><p>Utilizado para elaboração de cálculos com base em regras diferenciadas: Pessoa com Deficiência (PCD), conforme Lei Complementar nº 142/2013 ou Rurícola.</p><h5 id="nb" tabindex="-1">NB <a class="header-anchor" href="#nb" aria-label="Permalink to &quot;NB&quot;">​</a></h5><p>Campo opcional para informação do Número do Benefício (NB), que constará nos demonstrativos.</p><h5 id="der" tabindex="-1">DER <a class="header-anchor" href="#der" aria-label="Permalink to &quot;DER&quot;">​</a></h5><p>Campo obrigatório. Data na qual será realizada a análise de requisitos para concessão dos benefícios ou utilizada como data de início do benefício (DIB) para cálculo da Renda Mensal Inicial (RMI), caso não tenha sido informada uma DER Reafirmada.</p><h5 id="der-reafirmada" tabindex="-1">DER Reafirmada <a class="header-anchor" href="#der-reafirmada" aria-label="Permalink to &quot;DER Reafirmada&quot;">​</a></h5><p>Campo opcional para inserção de mais uma data na qual será realizada a análise de requisitos, bem como o cálculo da Renda Mensal Inicial (RMI).</p><h5 id="especie" tabindex="-1">Espécie <a class="header-anchor" href="#especie" aria-label="Permalink to &quot;Espécie&quot;">​</a></h5><p>Utilizado para definir a espécie de benefício que será analisada/calculada pela ferramenta.</p><table tabindex="0"><thead><tr><th>Código</th><th style="text-align:center;">Espécie</th></tr></thead><tbody><tr><td>21</td><td style="text-align:center;">Pensão por morte previdenciária</td></tr><tr><td>25</td><td style="text-align:center;">Auxílio-reclusão</td></tr><tr><td>31</td><td style="text-align:center;">Auxílio por incapacidade temporária (antigo Auxílio-doença)</td></tr><tr><td>32</td><td style="text-align:center;">Aposentadoria por incapacidade permanente (antiga Aposentadoria por invalidez)</td></tr><tr><td>36</td><td style="text-align:center;">Auxílio-acidente previdenciário</td></tr><tr><td>41</td><td style="text-align:center;">Aposentadoria por idade</td></tr><tr><td>42</td><td style="text-align:center;">Aposentadoria por tempo de contribuição</td></tr><tr><td>46</td><td style="text-align:center;">Aposentadoria especial</td></tr><tr><td>57</td><td style="text-align:center;">Aposentadoria por tempo de serviço do professor</td></tr><tr><td>80</td><td style="text-align:center;">Salário-maternidade</td></tr><tr><td>91</td><td style="text-align:center;">Auxílio-doença acidentário</td></tr><tr><td>92</td><td style="text-align:center;">Aposentadoria por invalidez acidentária</td></tr><tr><td>93</td><td style="text-align:center;">Pensão por morte acidentária</td></tr></tbody></table><hr><h3 id="tempo" tabindex="-1">Tempo <a class="header-anchor" href="#tempo" aria-label="Permalink to &quot;Tempo&quot;">​</a></h3><p>Na subaba <code>Tempo</code>, temos os seguintes blocos:</p><ol><li><a href="/docs/tc.html#opcoes-gerais"><code>Opções Gerais</code></a></li><li><a href="/docs/tc.html#opcoes-pcd"><code>Opções PCD</code></a></li></ol><h4 id="opcoes-gerais" tabindex="-1">Opções Gerais <a class="header-anchor" href="#opcoes-gerais" aria-label="Permalink to &quot;Opções Gerais&quot;">​</a></h4><p>Neste bloco, temos as seguintes opções de configuração:</p><ol><li><code>Marco carência</code>: Critério utilizado para definir a carência necessária para concessão do benefício. Padrão: <code>Idade</code> (data em que o segurado implementar o requiisito etário).</li><li><code>Carência necessária após EC 103</code>: Opção para determinar a exigência do requisito carência para benefícios concedidos após a Emenda Constitucional nº 103/2019. Padrão: Sim. Fundamento: artigo 29, II do Decreto 3.048/99 (redação dada pelo Decreto 10.410/2020)</li><li><code>Excluir competências abaixo do mínimo após a EC 103</code>: Opção para processamento e exclusão automática das competências que possuem salários (inseridos na aba <a href="/docs/tc.html#salarios"><code>Salários</code></a>) abaixo do mínimo. Padrão: Sim.</li></ol><h4 id="opcoes-pcd" tabindex="-1">Opções PCD <a class="header-anchor" href="#opcoes-pcd" aria-label="Permalink to &quot;Opções PCD&quot;">​</a></h4><p>Neste bloco, temos a opção de definir o critério utilizado como <code>Requisito B41</code>, estabelecendo os requisitos para concessão da aposentadoria por idade da pessoa com deficiência. Padrão: <code>Art. 70-C § 1º Dec. 3.048/99</code> (tempo de contribuição de 15 (quinze) anos cumpridos <strong>na condição de pessoa com deficiência</strong>).</p><div class="warning custom-block"><p class="custom-block-title">❗ IMPORTANTE</p><p>Na versão mais recente, os períodos de deficiência devem ser inseridos na aba <code>Períodos</code>, subaba <a href="/docs/tc.html#deficiencia"><code>Deficiência</code></a>.</p></div><hr><h3 id="rmi" tabindex="-1">RMI <a class="header-anchor" href="#rmi" aria-label="Permalink to &quot;RMI&quot;">​</a></h3><p>Nesta subaba, temos os seguintes blocos:</p><ol><li><a href="/docs/tc.html#opcoes-gerais-1"><code>Opções Gerais</code></a></li><li><a href="/docs/tc.html#calculo-rmi-desvinculada"><code>Cálculo RMI Desvinculada</code></a></li><li><a href="/docs/tc.html#opcoes-gerais-rmi"><code>Opções Gerais RMI</code></a></li></ol><h4 id="opcoes-gerais-1" tabindex="-1">Opções Gerais <a class="header-anchor" href="#opcoes-gerais-1" aria-label="Permalink to &quot;Opções Gerais&quot;">​</a></h4><p>Neste bloco, temos a opção de aplicar o índice referente ao IRSM de fevereiro de 1.994 (Ação Civil Pública nº 2003.70.00.070714-7).</p><h4 id="calculo-rmi-desvinculada" tabindex="-1">Cálculo RMI Desvinculada <a class="header-anchor" href="#calculo-rmi-desvinculada" aria-label="Permalink to &quot;Cálculo RMI Desvinculada&quot;">​</a></h4><p>Neste bloco, são apresentados campos que possibilitam o cálculo de uma RMI <strong>desvinculada dos períodos inseridos na aba <code>Períodos</code></strong>.</p><p>Os campos de preenchimento são: <a href="/docs/tc.html#coeficiente">Coeficiente</a>, <a href="/docs/tc.html#aplicar-fator-previdenciario-apos-a-ec-103">Aplicar fator previdenciário após a EC 103</a> e o <a href="/docs/tc.html#tempo-informado">tempo informado</a> (em <code>Anos</code>, <code>Meses</code> e <code>Dias</code>).</p><div class="warning custom-block"><p class="custom-block-title">❗ IMPORTANTE</p><p>Caso haja inserção de dados nesta subaba serão <strong>desconsiderados</strong> os dados calculados na aba <code>Cálculo Tempo</code>. Também não será possível realizar o cálculo pela &quot;regra dos descartes&quot;.</p></div><h5 id="coeficiente" tabindex="-1">Coeficiente <a class="header-anchor" href="#coeficiente" aria-label="Permalink to &quot;Coeficiente&quot;">​</a></h5><p>Campo para inserção do percentual que será utilizado para efeito de coeficiente de cálculo da Renda Mensal Inicial (RMI).</p><h5 id="aplicar-fator-previdenciario-apos-a-ec-103" tabindex="-1">Aplicar fator previdenciário após a EC 103 <a class="header-anchor" href="#aplicar-fator-previdenciario-apos-a-ec-103" aria-label="Permalink to &quot;Aplicar fator previdenciário após a EC 103&quot;">​</a></h5><p>Campo para definir se o o fator previdenciário deve ser aplicado para um cálculo de benefício com data de início (DIB) posterior á Emenda Constitucional nº 103/2019.</p><h5 id="tempo-informado" tabindex="-1">Tempo informado <a class="header-anchor" href="#tempo-informado" aria-label="Permalink to &quot;Tempo informado&quot;">​</a></h5><p>Campos para inserção do tempo de contribuição que será utilizado para o cálculo (deve ser informado em <code>Anos</code>, <code>Meses</code> e <code>Dias</code>).</p><h4 id="opcoes-gerais-rmi" tabindex="-1">Opções Gerais RMI <a class="header-anchor" href="#opcoes-gerais-rmi" aria-label="Permalink to &quot;Opções Gerais RMI&quot;">​</a></h4><p>Neste bloco, temos as seguintes opções:</p><ol><li><a href="/docs/tc.html#criterio-salario-maternidade"><code>Critério Salário-Maternidade</code></a></li><li><a href="/docs/tc.html#calcular-rmi-de-pcd-conforme-lei-no-9-876-99"><code>Calcular RMI de PCD conforme Lei nº 9.876/99</code></a></li></ol><h5 id="criterio-salario-maternidade" tabindex="-1">Critério Salário-Maternidade <a class="header-anchor" href="#criterio-salario-maternidade" aria-label="Permalink to &quot;Critério Salário-Maternidade&quot;">​</a></h5><p>Neste campo, é possível definir o critério de cálculo que será adotado na apuração do valor do salário-maternidade.</p><p>Caso a DIB seja definida antes da vigência do Decreto 10.410/2020, a ferramenta apenas calcula o valor com base no disposto no art. 73, III, da Lei nº 8.213/91 (1/12 do soma dos salários de contribuição corrigidos), ou seja, para as seguradas contribuinte individual e faculltativa;</p><p>Caso a DIB seja informada já na vigência do Decreto 10.410/2020, há opção de cálculo também com base no disposto no art. 100-B (regra da empregada intermitente), ou seja, pela média aritmética simples dos salários de contribuição corrigidos apurados no período referente aos últimos doze meses.</p><h5 id="calcular-rmi-de-pcd-conforme-lei-no-9-876-99" tabindex="-1">Calcular RMI de PCD conforme Lei nº 9.876/99 <a class="header-anchor" href="#calcular-rmi-de-pcd-conforme-lei-no-9-876-99" aria-label="Permalink to &quot;Calcular RMI de PCD conforme Lei nº 9.876/99&quot;">​</a></h5><p>Neste campo, é possível alterar a regra de cálculo da Renda mensal Inicial (RMI) das aposentadorias da pessoa com deficiência para aplicar a regra do artigo 29 da Lei 9.876/99 (média aritmética simples dos maiores salários-de-contribuição correspondentes a <strong>oitenta por cento</strong> de todo o período contributivo).</p><h2 id="aba-periodos" tabindex="-1">Aba Períodos <a class="header-anchor" href="#aba-periodos" aria-label="Permalink to &quot;Aba Períodos&quot;">​</a></h2><p>A aba <code>Períodos</code> está dividida em duas subabas:</p><ol><li><a href="/docs/tc.html#contribuicao"><code>Contribuição</code></a></li><li><a href="/docs/tc.html#deficiencia"><code>Deficiência</code></a></li></ol><h3 id="contribuicao" tabindex="-1">Contribuição <a class="header-anchor" href="#contribuicao" aria-label="Permalink to &quot;Contribuição&quot;">​</a></h3><p>Nesta subaba devem ser importados/inseridos todos os períodos relevantes para análise dos requisitos dos benefícios. Para adicionar novos períodos, basta clicar no botão <code>+ Adicionar</code>, inserir a <code>Data inicial</code>, <code>Data final</code>, <code>Descrição</code> (opcional) e teclar <code>Enter</code>ou clicar no botão <code>+</code>. <img src="'+N+'" alt="Adicionar período"> Para cada um dos períodos podem ser atribuídas características com base nos seguintes campos:</p><ul><li><a href="/docs/tc.html#enquadramento"><code>Enquadramento</code></a>;</li><li><a href="/docs/tc.html#prioritario"><code>Prioritário</code></a>;</li><li><a href="/docs/tc.html#contar-carencia"><code>Contar Carência</code></a>;</li><li><a href="/docs/tc.html#forma-de-filiação"><code>Forma de Filiação</code></a>;</li><li><a href="/docs/tc.html#computavel-desde"><code>Computável Desde</code></a>;</li><li><a href="/docs/tc.html#fator-modificado"><code>Fator Modificado</code></a>;</li><li><a href="/docs/tc.html#motivo-contagem"><code>Motivo Contagem</code></a>;</li><li><a href="/docs/tc.html#observacao"><code>Observação</code></a>.</li></ul><h4 id="enquadramento" tabindex="-1">Enquadramento <a class="header-anchor" href="#enquadramento" aria-label="Permalink to &quot;Enquadramento&quot;">​</a></h4><p>Campo utilizado para classificar o período numa das seguintes classes: <a href="/docs/tc.html#nao-computar">Não Computar</a>, <a href="/docs/tc.html#comum">Comum</a>, <a href="/docs/tc.html#especial-25-especial-20-e-especial-15">Especial 25</a>, <a href="/docs/tc.html#especial-25-especial-20-e-especial-15">Especial 20</a>, <a href="/docs/tc.html#especial-25-especial-20-e-especial-15">Especial 15</a>, <a href="/docs/tc.html#rural">Rural</a>, <a href="/docs/tc.html#magisterio">Magistério</a>.</p><h5 id="nao-computar" tabindex="-1">Não Computar <a class="header-anchor" href="#nao-computar" aria-label="Permalink to &quot;Não Computar&quot;">​</a></h5><p>Ao atribuir a classificação <code>Não Computar</code>, o período não será considerado para efeito de tempo de contribuição ou carência.</p><h5 id="comum" tabindex="-1">Comum <a class="header-anchor" href="#comum" aria-label="Permalink to &quot;Comum&quot;">​</a></h5><p>Classificação utilizada para definir um período sem nenhuma especialidade.</p><h5 id="especial-25-especial-20-e-especial-15" tabindex="-1">Especial 25, Especial 20 e Especial 15 <a class="header-anchor" href="#especial-25-especial-20-e-especial-15" aria-label="Permalink to &quot;Especial 25, Especial 20 e Especial 15&quot;">​</a></h5><p>Classificações utilizada para definir um período trabalhado sujeito a condições especiais (artigo 57 da Lei 8.213/91).</p><h5 id="rural" tabindex="-1">Rural <a class="header-anchor" href="#rural" aria-label="Permalink to &quot;Rural&quot;">​</a></h5><p>Classificação utilizada um período laborado na condição de trabalhador rural. Apenas os períodos classificados dessa forma são computados para análise da espécie 41 - Aposentadoria por idade, tipo: <code>Rurícola</code>. Caso o tipo de segurado selecionado seja <code>Comum</code>, o padrão é que o período <code>Rural</code> não seja computado para efeito de carência (caixa <code>Contar Carência</code>é desmarcada)</p><h5 id="magisterio" tabindex="-1">Magistério <a class="header-anchor" href="#magisterio" aria-label="Permalink to &quot;Magistério&quot;">​</a></h5><p>Classificação utilizada para análise da espécie <code>57 - Aposentadoria por tempo de serviço do professor</code>.</p><h4 id="prioritario" tabindex="-1">Prioritário <a class="header-anchor" href="#prioritario" aria-label="Permalink to &quot;Prioritário&quot;">​</a></h4><p>Tendo em vista a vedação do cômputo de períodos em duplicidade, a ferraemnta executa a eliminação automática de períodos concomitantes. A regra utilizada para referida análise leva em conta os seguintes critérios: &quot;peso&quot; e &quot;antiguidade&quot;. Dessa forma, num primeiro momento o período que tiver maior peso prevalecerá em relação aos demais. No caso de concomitâncias de períodos com mesmo &quot;peso&quot;, prevalecerá o período mais antigo. A marcação do campo <code>Prioritário</code> modifica a lógica de eliminação de concomitâncias, fazendo prevalecer o período que tenha essa classificação. No caso de dois períodos marcados como <code>Prioritário</code>, aplicam-se os critérios de &quot;peso&quot; e &quot;antiguidade&quot;.</p><h4 id="contar-carencia" tabindex="-1">Contar Carência <a class="header-anchor" href="#contar-carencia" aria-label="Permalink to &quot;Contar Carência&quot;">​</a></h4><p>Conforme artigo 24 da Lei 8.213/91, carência é o <em>número mínimo de contribuições mensais indispensáveis para que o benefício faça jus ao benefício</em>. A lei estabelece as situações em que as contribuções devem ser consideradas. Caso o usuário entenda que o período não deve ser computada para efeito de carência, é possível desmarcar a seleção referente ao campo <code>Contar Carência</code>.</p><h4 id="forma-de-filiacao" tabindex="-1">Forma de Filiação <a class="header-anchor" href="#forma-de-filiacao" aria-label="Permalink to &quot;Forma de Filiação&quot;">​</a></h4><p>Campo utilizado para classificar o período numa das seguintes classes: <code>-</code> (sem classe especificada), <code>Benefício por Incapacidade</code>, <code>Empregado(a)</code>, <code>Empregado(a) Doméstico(a)</code>, <code>Contribuinte individual</code>, <code>Trabalhador Avulso</code>, <code>Segurado(a) Especial</code>, <code>Segurado(a) Facultativo</code>.</p><p>Conforme disposto no artigo 195, §14 da Constituição Federal de 1.988, incluído pela Emenda Constitucional nº 103/2019, somente será reconhecida a competência cuja contribuição seja igual ou superior à contribuição mínima mensal. O parágrafo 2º do artigo 19-2C do Decreto 3.048/99 (incluído pelo Decreto 10.410/2020) dispõe que as competências serão computadas integralmente como tempo de contribuição, independentemente da quantidade de dias trabalhados.</p><p>Atualmente o critério acima é adotado como padrão pela ferramenta para todas as formas de filiação, com exceção da classe <code>Benefício por Incapacidade</code> (cômputo de forma proporcional, data a data).</p><p>Em relação aos períodos em que o segurado recebeu benefício por incapacidade, verifica-se os seguintes critérios administrativos:</p><ul><li>as contagens do INSS utilizam o cômputo dia a dia, ou seja, proporcional;</li><li>os períodos somente são computados a partir da data em que estão efetivamente intercalados com outro período;</li><li>o valor do benefício não é somado com salários de contribuição para efeito de verificação de existência de contribuição mínima mensal conforme disposto no artigo 124, §12 da Instrução normativa PRES/INSS nº 128/2022.</li></ul><h4 id="computavel-desde" tabindex="-1">Computável Desde <a class="header-anchor" href="#computavel-desde" aria-label="Permalink to &quot;Computável Desde&quot;">​</a></h4><p>Campo criado para que o período seja computado nas totalizações apenas a partir de uma data determinada pelo usuário.</p><p>A data será exibida na forma de nota no Demonstrativo após as totalizações da seguinte forma: <img src="'+k+'" alt="Nota Computável Desde"></p><div class="warning custom-block"><p class="custom-block-title">❗ IMPORTANTE</p><p>Um período classificado com a <a href="/docs/tc.html#forma-de-filiacao">Forma de Filiação</a> <code>Benefício por Incapacidade</code> possui como padrão o <code>Computável desde</code> igual à data de início do primeiro período posterior (excetuados outros períodos classificados como <code>Benefício por Incapacidade</code>).</p></div><h4 id="fator-modificado" tabindex="-1">Fator Modificado <a class="header-anchor" href="#fator-modificado" aria-label="Permalink to &quot;Fator Modificado&quot;">​</a></h4><p>Campo criado para alteração do fator de conversão aplicável ao período.</p><div class="warning custom-block"><p class="custom-block-title">❗ IMPORTANTE</p><p>Tendo em vista que a ferramenta já aplica os fatores diferenciados constantes nas tabelas dos artigos 70, 70-E, 70-F do Decreto 3.048/99 (para ambos os sexos: especiais 15, 20 e 25, bem como deficiência de graus leve, moderada e grave), a opção <code>Fator Modificado</code> somente deve ser utilizada nos casos em que o resultado não corresponda ao que o usuário deseja ser computado</p></div><h4 id="motivo-contagem" tabindex="-1">Motivo Contagem <a class="header-anchor" href="#motivo-contagem" aria-label="Permalink to &quot;Motivo Contagem&quot;">​</a></h4><p>Campo opcional criado para seleção de motivo que levaram ao cômputo do período:</p><ul><li><code>Contagem INSS</code>;</li><li><code>Sentença/Acórdão</code>;</li><li><code>Determ. Judicial</code>;</li><li><code>Pedido Inicial</code>;</li><li><code>CTC</code>.</li></ul><div class="tip custom-block"><p class="custom-block-title">💡 DICA</p><p>Os períodos classificados com algum <code>Motivo Contagem</code> podem ser filtrados nas configurações da ferramenta <a href="/docs/tc.html#gerar-texto">Gerar texto</a></p></div><h4 id="observacao" tabindex="-1">Observação <a class="header-anchor" href="#observacao" aria-label="Permalink to &quot;Observação&quot;">​</a></h4><p>Campo opcional para inserção de quaisquer informações referentes aos períodos.</p><div class="warning custom-block"><p class="custom-block-title">❗ IMPORTANTE</p><p><strong>Os períodos do <a href="/docs/tc.html#importacao-do-extrato-cnis-relacoes-previdenciarias-e-remuneracoes-e-dados-de-outras-planilhas">extrato CNIS (Relações Previdenciárias e Remunerações)</a> são importados com a observação &quot;CNIS (seq. X)&quot;, podendo ser alterados caso o usuário assim entenda pertinente</strong></p></div><h4 id="concomitancia" tabindex="-1">Concomitância <a class="header-anchor" href="#concomitancia" aria-label="Permalink to &quot;Concomitância&quot;">​</a></h4><p>A ferramenta elimina os períodos concomitantes automaticamente. Nesta coluna são indicados os períodos que apresentam concomitância com outros.</p><h4 id="teclas-de-atalho" tabindex="-1">Teclas de atalho ⚡ <a class="header-anchor" href="#teclas-de-atalho" aria-label="Permalink to &quot;Teclas de atalho :zap:&quot;">​</a></h4><p>Recomenda-se o uso do teclado para navegação e inserção de dados na aba <code>Períodos</code> (subaba <a href="/docs/tc.html#contribuicao">Contribuição</a>), tendo em vista a possibilidade de utilizar as seguintes <strong>teclas de atalho</strong>:</p><table tabindex="0"><thead><tr><th>Tecla de atalho</th><th style="text-align:center;">Comando</th></tr></thead><tbody><tr><td>CONTROL+C</td><td style="text-align:center;">Copiar</td></tr><tr><td>CONTROL+V</td><td style="text-align:center;">Colar</td></tr><tr><td>CONTROL+X</td><td style="text-align:center;">Recortar</td></tr><tr><td>CONTROL+Z</td><td style="text-align:center;">Desfazer</td></tr><tr><td>CONTROL+Y</td><td style="text-align:center;">Refazer</td></tr></tbody></table><h4 id="periodo-adicionado" tabindex="-1">Período adicionado <a class="header-anchor" href="#periodo-adicionado" aria-label="Permalink to &quot;Período adicionado&quot;">​</a></h4><p>O período adicionado possui alguns botões de ação:</p><p><img src="'+S+'" alt="Botões período adicionado"></p><h5 id="botao-excluir-linha" tabindex="-1">Botão &quot;Excluir linha&quot; <a class="header-anchor" href="#botao-excluir-linha" aria-label="Permalink to &quot;Botão &quot;Excluir linha&quot;&quot;">​</a></h5><p><img src="'+i+'" alt="Botão Excluir"></p><p>Clicando neste botão, o período será excluído após a confirmação.</p><h5 id="botao-desabilitar-linha" tabindex="-1">Botão &quot;Desabilitar linha&quot; <a class="header-anchor" href="#botao-desabilitar-linha" aria-label="Permalink to &quot;Botão &quot;Desabilitar linha&quot;&quot;">​</a></h5><p><img src="'+r+'" alt="Botão Desabilitar"></p><p>Clicando neste botão, é possível desabilitar um período, que não será utilizado nos cálculos.</p><h5 id="botao-recortar-periodo" tabindex="-1">Botão &quot;Recortar período&quot; <a class="header-anchor" href="#botao-recortar-periodo" aria-label="Permalink to &quot;Botão &quot;Recortar período&quot;&quot;">​</a></h5><p><img src="'+E+'" alt="Botão Excluir"></p><p>Clicando neste botão, o período será dividido, bastando digitar a data de recorte.</p><hr><h3 id="deficiencia" tabindex="-1">Deficiência <a class="header-anchor" href="#deficiencia" aria-label="Permalink to &quot;Deficiência&quot;">​</a></h3><p>Nesta subaba devem ser inseridos os períodos de deficiencia e seu respectivo grau para análise dos requisitos das aposentadorias da pessoa com deficiência. Para adicionar novos períodos, basta clicar no botão <code>+ Adicionar</code>, inserir a <code>Data inicial</code>, <code>Data final</code>, <code>Observação</code> (opcional) e teclar <code>Enter</code>ou clicar no botão <code>+</code>: <img src="'+D+'" alt="Adicionar Período PCD"> Após isso, cada um dos períodos deve ser classificado com base no grau de deficiência (leve, moderada ou grave).</p><h2 id="aba-salarios" tabindex="-1">Aba Salários <a class="header-anchor" href="#aba-salarios" aria-label="Permalink to &quot;Aba Salários&quot;">​</a></h2><p>Nesta aba devem ser importados/inseridos todos os valores relevantes para o cálculo da renda mensal inicial (RMI) dos benefícios, divididos nas subabas:</p><ol><li><a href="/docs/tc.html#salarios">Salários</a></li><li><a href="/docs/tc.html#beneficios">Benefícios</a></li></ol><h3 id="salarios" tabindex="-1">Salários <a class="header-anchor" href="#salarios" aria-label="Permalink to &quot;Salários&quot;">​</a></h3><p>Para adicionar novos valores, basta utilizar o campo <code>Modificador</code>. Também é possível adicionar uma <code>Observação</code> em cada competência.</p><p>É possível importar salários de contribuição do CNIS/SAT e/ou da Carta de Concessão de benefício concedido pelo INSS. Nesse caso, a ordem de priorização de utilização de valores será a seguinte:</p><ol><li><code>Modificador</code></li><li><code>Salários INSS</code> (importados da Carta de Concessão)</li><li><code>Salários CNIS</code> (importados do CNIS/SAT)</li></ol><div class="tip custom-block"><p class="custom-block-title">💡 DICA</p><p>Para navegar diretamente para uma competência, basta digitar o mês e o ano (formato mm/aaaa) no campo de busca localizado acima da tabela <img src="'+d+'" alt="Campo competência"></p></div><div class="tip custom-block"><p class="custom-block-title">💡 DICA</p><p>Também é possível utilizar as mesmas <a href="/docs/tc.html#teclas-de-atalho">teclas de atalho</a> descritas anteriormente</p></div><h3 id="beneficios" tabindex="-1">Benefícios <a class="header-anchor" href="#beneficios" aria-label="Permalink to &quot;Benefícios&quot;">​</a></h3><p>Nesta subaba, é possível inserir benefícios concedidos pelo INSS para que a ferramenta aplique os mesmos critérios de reajustamento do INSS, incluindo o valor no cálculo da Renda Mensal Inicial (RMI).</p><p>Para adicionar novos benefícios, basta clicar no botão <code>+ Adicionar</code>, inserir os dados <strong>obrigatórios</strong>: <code>Espécie</code>, <code>DIB</code> e <code>RMI</code>/<code>SB</code> e clicar no botão <code>Criar</code>.</p><p>Tendo em vista as peculiaridades de cada benefício/situação, existem 9 (nove) campos no total:</p><ul><li><code>Espécie</code></li><li><code>NB</code> (Número do Benefício)</li><li><code>DIB</code> (Data de Início do Benefício)</li><li><code>DCB</code> (Data de Cessação do Benefício)</li><li><code>RMI</code> (Renda Mensal Inicial) ou<code>SB</code> (Salário-de-Benefício)</li><li><code>Índice Reposição Teto</code></li><li><code>Limitar Base Reajuste</code></li><li><code>Computar A Partir de</code></li><li><code>Observação</code></li><li><code>Percentual Redução Piso</code> (apenas para a <code>Espécie</code> <code>36 - Auxílio-Acidente previdenciário</code>)</li><li><code>Computar Somente com Salário</code> (apenas para a <code>Espécie</code> <code>36 - Auxílio-Acidente previdenciário</code>)</li></ul><div class="tip custom-block"><p class="custom-block-title">💡 DICA</p><p>Os períodos classificados com a <a href="/docs/tc.html#forma-de-filiacao">Forma de Filiação</a> <code>Benefício por Incapacidade</code> na aba <code>Períodos</code> (subaba <a href="/docs/tc.html#contribuicao">Contribuição</a>) terão os dados (<code>DIB</code> e <code>DCB</code>) transferidos automaticamente para a aba <code>Salários</code> (subaba <a href="/docs/tc.html#beneficios">Benefícios</a>), bastando preencher o valor (<code>RMI</code> ou<code>SB</code>) ou mais algum dado necessário no caso concreto.</p></div><h3 id="beneficio-adicionado" tabindex="-1">Benefício adicionado <a class="header-anchor" href="#beneficio-adicionado" aria-label="Permalink to &quot;Benefício adicionado&quot;">​</a></h3><p>O benefício adicionado possui o seguinte quadro para visualização:</p><p><img src="'+t+'" alt="Quadro benefício adicionado"></p><h4 id="botao-desabilitar" tabindex="-1">Botão &quot;Desabilitar&quot; <a class="header-anchor" href="#botao-desabilitar" aria-label="Permalink to &quot;Botão &quot;Desabilitar&quot;&quot;">​</a></h4><p><img src="'+r+'" alt="Botão Desabilitar"></p><p>Clicando neste botão, é possível desabilitar um benefício. Um benefício desabilitado não será utilizado para apuração dos valores, mas manterá eventual vínculação com um benefício derivado.</p><h4 id="botao-excluir" tabindex="-1">Botão &quot;Excluir&quot; <a class="header-anchor" href="#botao-excluir" aria-label="Permalink to &quot;Botão &quot;Excluir&quot;&quot;">​</a></h4><p><img src="'+i+'" alt="Botão Excluir"></p><p>Clicando neste botão, o benefício é excluído.</p><h4 id="botao-duplicar-beneficio" tabindex="-1">Botão &quot;Duplicar benefício&quot; <a class="header-anchor" href="#botao-duplicar-beneficio" aria-label="Permalink to &quot;Botão &quot;Duplicar benefício&quot;&quot;">​</a></h4><p><img src="'+c+'" alt="Botão Duplicar benefício"></p><p>Clicando neste botão, é possível criar uma cópia com os dados do benefício.</p><h4 id="botao-detalhes" tabindex="-1">Botão &quot;Detalhes&quot; <a class="header-anchor" href="#botao-detalhes" aria-label="Permalink to &quot;Botão &quot;Detalhes&quot;&quot;">​</a></h4><p><img src="'+l+'" alt="Botão Detalhes"></p><p>Clicando neste botão, uma janela com os detalhes do benefício é aberta.</p><p><img src="'+z+'" alt="Janela Detalhes do Benefício"></p><h4 id="botao-editar" tabindex="-1">Botão &quot;Editar&quot; <a class="header-anchor" href="#botao-editar" aria-label="Permalink to &quot;Botão &quot;Editar&quot;&quot;">​</a></h4><p><img src="'+n+'" alt="Botão Editar"></p><p>Clicando neste botão, uma janela com os parâmetros do benefício é aberta.</p><p><img src="'+T+'" alt="Janela Editar Benefício"></p><h4 id="botao-adicionar-derivado" tabindex="-1">Botão &quot;Adicionar derivado&quot; <a class="header-anchor" href="#botao-adicionar-derivado" aria-label="Permalink to &quot;Botão &quot;Adicionar derivado&quot;&quot;">​</a></h4><p><img src="'+m+'" alt="Botão Adicionar"></p><p>Clicando neste botão, um benefício derivado será gerado automaticamente. Esta é a visualização um benefício derivado vinculado a um benefício originário:</p><p><img src="'+j+'" alt="enefício derivado"></p><p>É necessário que o benefício originário possua uma DCB para geração do benefício derivado. Caso o benefício originário não possua uma DCB, o botão fica desabilitado (cor laranja):</p><p><img src="'+p+'" alt="Botão Adicionar"></p><h2 id="aba-calculo-tempo" tabindex="-1">Aba Cálculo Tempo <a class="header-anchor" href="#aba-calculo-tempo" aria-label="Permalink to &quot;Aba Cálculo Tempo&quot;">​</a></h2><p>Nesta aba, serão exibidos os resultados decorrentes das informações lançadas na ferramenta, podendo ser detalhados os demonstrativos dos seguintes marcos temporais:</p><ol><li><a href="/docs/tc.html#der">DER</a></li><li><a href="/docs/tc.html#der-reafirmada">DER Reafirmada</a></li><li><a href="/docs/tc.html#hoje">Hoje</a></li></ol><h3 id="der-1" tabindex="-1">DER <a class="header-anchor" href="#der-1" aria-label="Permalink to &quot;DER&quot;">​</a></h3><p>Os dados e resultados são separados nos seguintes blocos:</p><ol><li><a href="/docs/tc.html#informacoes-e-parametros-gerais">Informações e Parâmetros Gerais</a>;</li><li><a href="/docs/tc.html#periodos-calculados">Períodos Calculados</a>;</li><li><a href="/docs/tc.html#analise-de-requisitos">Análise de requisitos</a>.</li></ol><div class="warning custom-block"><p class="custom-block-title">❗ IMPORTANTE</p><p><strong>Somente</strong> serão demonstradas informações na subaba <code>DER Reafirmada</code>, caso tenha sido informada alguma data no campo <code>DER Reafirmada</code>da aba <code>Parâmetros</code> (subaba <code>Geral</code>)</p></div><h4 id="informacoes-e-parametros-gerais" tabindex="-1">Informações e Parâmetros Gerais <a class="header-anchor" href="#informacoes-e-parametros-gerais" aria-label="Permalink to &quot;Informações e Parâmetros Gerais&quot;">​</a></h4><p>Neste bloco, temos os dados referentes às informações e parâmetros gerais: <img src="'+M+'" alt="Informações e parâmetros"></p><h4 id="periodos-calculados" tabindex="-1">Períodos Calculados <a class="header-anchor" href="#periodos-calculados" aria-label="Permalink to &quot;Períodos Calculados&quot;">​</a></h4><p>Neste bloco, são apresentados os períodos considerados (e todas suas características) para totalização do tempo de contribuição: <img src="'+Q+'" alt="Periodos calculados"></p><div class="warning custom-block"><p class="custom-block-title">❗ IMPORTANTE</p><p>Caso tenham sido inseridos períodos de deficiência, será acrescida uma observação colorida na coluna D: <img src="'+U+'" alt="Exemplo periodo PCD"><img src="'+O+'" alt="Legenda"></p></div><h4 id="analise-de-requisitos" tabindex="-1">Análise de requisitos <a class="header-anchor" href="#analise-de-requisitos" aria-label="Permalink to &quot;Análise de requisitos&quot;">​</a></h4><p>Neste bloco, são apresentadas as análises dos requisitos para a concessão da aposentadoria, divididos em: Requisitos Cumpridos (em verde), Requisitos Não Cumpridos (em vermelho): <img src="'+F+'" alt="Requisitos cumpridos"><img src="'+y+'" alt="Requisitos não cumpridos"></p><h3 id="der-reafirmada-1" tabindex="-1">DER Reafirmada <a class="header-anchor" href="#der-reafirmada-1" aria-label="Permalink to &quot;DER Reafirmada&quot;">​</a></h3><p>Caso tenha sido inserida uma data no campo <code>DER Reafirmada</code> na aba <code>Parâmetros</code>, surgirá uma aba <code>DER Reafirmada</code>, em que é realizada a análise da mesma forma que na aba <code>DER</code>, mas considerando os dados obtidos até a <code>DER Reafirmada</code>.</p><h3 id="hoje" tabindex="-1">Hoje <a class="header-anchor" href="#hoje" aria-label="Permalink to &quot;Hoje&quot;">​</a></h3><p>Aqui temos novamente a análise dos requisitos para concessão da aposentadoria. Todavia, caso tenha sido constatado o implemento dos requisitos entre a <code>DER</code> e a data atual, o demonstrativo exibe a análise de <code>Possível reafirmação de DER</code> (em laranja), em que é calculada a data em que determinado requisito foi implementado, considerados os períodos lançados até a data atual. <img src="'+H+'" alt="Análise Reafirmação da DER"></p><h4 id="botao-reafirmar-der" tabindex="-1">Botão Reafirmar DER <a class="header-anchor" href="#botao-reafirmar-der" aria-label="Permalink to &quot;Botão Reafirmar DER&quot;">​</a></h4><p><img src="'+X+'" alt="Botão Reafirmar DER"></p><p>Quando for possível a reafirmação de DER, clique no botão para inserir automaticamente a data exata do cumprimento dos requisitos no campo <code>DER Reafirmada</code>.</p><h2 id="aba-calculo-rmi" tabindex="-1">Aba Cálculo RMI <a class="header-anchor" href="#aba-calculo-rmi" aria-label="Permalink to &quot;Aba Cálculo RMI&quot;">​</a></h2><p>Nesta aba, o cálculo da RMI é processado, sendo possível visualizar diversos demonstrativos. Dividida nas seguintes subabas:</p><ol><li><a href="/docs/tc.html#calculo">Cálculo</a></li><li><a href="/docs/tc.html#deemonstrativo">Demonstrativo</a></li></ol><h3 id="calculo" tabindex="-1">Cálculo <a class="header-anchor" href="#calculo" aria-label="Permalink to &quot;Cálculo&quot;">​</a></h3><p>O cálculo é processado clicando no botão <code>Calcular</code>. Durante o processamento, é possível interromper o cálculo clicando no botão <code>Parar</code>. O cálculo também é interrompido caso seja alterado algum parâmetro ou dado inserido nas outras abas.</p><p>O cálculo da RMI é realizado prioritariamente considerando os dados da <code>DER Reafirmada</code>, mas caso esta não tenha sido inserida, o cálculo será realizado considerando os dados na <code>DER</code>.</p><p>Quando o cálculo é finalizado, a sistemática mais vantajosa é realçada na cor verde. Após a finalização, é possível apagá-lo clicando no botão <code>Apagar</code>.</p><p>O cabeçalho aponta a <code>DIB</code> considerada, o valor da <code>RMI mais vantajosa</code> e o <code>fundamento</code> considerado para esta apuração.</p><p>Os cálculos são separados em seções, considerando o direito adquirido nos marcos temporais em que foi constatado direito ao benefício. No caso da <code>RMI desvinculada</code>, a RMI é calculada com base na sistemática na <code>DER</code> (ou <code>DER Reafirmada</code>).</p><p>Nos casos de aplicação da &quot;regra de descartes&quot;, é possível detalhar os valores obtidos a cada salário descartado, clicando em cada uma da seções.</p><p>É possível clicar na <em>estrela</em> para ser direcionado para a linha correspondente à sistemática mais vantajosa apurada pela aplicação.</p><h3 id="demonstrativo" tabindex="-1">Demonstrativo <a class="header-anchor" href="#demonstrativo" aria-label="Permalink to &quot;Demonstrativo&quot;">​</a></h3><p>Nesta subaba, os dados e resultados são separados nos seguintes blocos:</p><ol><li><a href="/docs/tc.html#informacoes-e-parametros-gerais">Informações e Parâmetros Gerais</a>;</li><li><a href="/docs/tc.html#beneficios-mais-vantajosos">Benefícios Mais Vantajosos</a> (apenas);</li><li><a href="/docs/tc.html#beneficio-calculado">Benefício Calculado</a>;</li><li><a href="/docs/tc.html#descartes-realizados">Descartes Realizados</a>;</li><li><a href="/docs/tc.html#salarios">Salários</a>.</li></ol><h4 id="informacoes-e-parametros-gerais-1" tabindex="-1">Informações e Parâmetros Gerais <a class="header-anchor" href="#informacoes-e-parametros-gerais-1" aria-label="Permalink to &quot;Informações e Parâmetros Gerais&quot;">​</a></h4><p>Neste bloco, temos os dados referentes às informações e parâmetros gerais utilizados e calculados para apuração do valor da Renda Mensal Inicial (RMI): <img src="'+w+'" alt="Informações e parâmetros RMI"></p><h4 id="beneficios-mais-vantajosos" tabindex="-1">Benefícios Mais Vantajosos <a class="header-anchor" href="#beneficios-mais-vantajosos" aria-label="Permalink to &quot;Benefícios Mais Vantajosos&quot;">​</a></h4><p>Quadro comparativo em que são demonstrados os valores apurados em cada sistemática de cálculo possível (incluindo, descartes e direito adquirido).</p><h4 id="beneficio-calculado" tabindex="-1">Benefício Calculado <a class="header-anchor" href="#beneficio-calculado" aria-label="Permalink to &quot;Benefício Calculado&quot;">​</a></h4><p>Bloco em que são demonstrados os valores dos requisitos apurados conforme sistemática mais vantajosa.</p><h4 id="descartes-realizados" tabindex="-1">Descartes realizados <a class="header-anchor" href="#descartes-realizados" aria-label="Permalink to &quot;Descartes realizados&quot;">​</a></h4><p>Caso o valor da RMI mais vantajosa tenha sido apurada com base na &quot;regra de descartes&quot;, são demonstrados todos os salários de contribuição descartados até apuração do valor da RMI mais vantajosa.</p><h4 id="salarios-1" tabindex="-1">Salários <a class="header-anchor" href="#salarios-1" aria-label="Permalink to &quot;Salários&quot;">​</a></h4><p>Quadro com todos os salários de contribuição utilizados. <br> Também constarão ao final os indexadores utilizados e as moedas dos meses das competências consideradas.</p><div class="warning custom-block"><p class="custom-block-title">❗ IMPORTANTE</p><p>É possível detalhar <strong>qualquer cálculo</strong> elaborado pela ferramenta, bastando selecioná-lo na subaba <code>Cálculo</code>, clicando no botão correspondente.</p></div><h3 id="exportacao-dos-dados-obtidos" tabindex="-1">Exportação dos dados obtidos <a class="header-anchor" href="#exportacao-dos-dados-obtidos" aria-label="Permalink to &quot;Exportação dos dados obtidos&quot;">​</a></h3><p>No canto direito dos demonstrativos, a ferramenta disponibiliza 4 formas de exportação dos dados calculados:</p><ol><li><a href="/docs/tc.html#imprimir-salvar-em-pdf">Imprimir/Salvar em PDF</a></li><li><a href="/docs/tc.html#gerar-imagem">Gerar imagem</a></li><li><a href="/docs/tc.html#botao-configuracoes">Configurações</a></li><li><a href="/docs/tc.html#gerar-csv">Gerar CSV</a></li><li><a href="/docs/tc.html#gear-texto">Gerar texto</a></li></ol><h4 id="imprimir-salvar-em-pdf" tabindex="-1">Imprimir/Salvar em PDF <a class="header-anchor" href="#imprimir-salvar-em-pdf" aria-label="Permalink to &quot;Imprimir/Salvar em PDF&quot;">​</a></h4><p><img src="'+u+'" alt="Botão Imprimir PDF"></p><p>Clicando neste botão é possível imprimir ou gerar um arquivo PDF do demonstrativo de cálculo.</p><h4 id="gerar-imagem" tabindex="-1">Gerar imagem <a class="header-anchor" href="#gerar-imagem" aria-label="Permalink to &quot;Gerar imagem&quot;">​</a></h4><p><img src="'+h+'" alt="Botão Gerar Imagem"></p><p>Ao selecionar esta opção, é aberta uma nova tela em que é possível selecionar qual parte do demonstrativo será convertida em imagem. Esta pode ser copiada (e colada em outros aplicativos) ou baixada para o computador.</p><h4 id="gerar-csv" tabindex="-1">Gerar CSV <a class="header-anchor" href="#gerar-csv" aria-label="Permalink to &quot;Gerar CSV&quot;">​</a></h4><p><img src="'+Z+'" alt="Botão Gerar CSV"></p><p>Nesta opção, é possível extrair os dados do demonstrativo em formato CSV (valores separados por vírgulas), comumente utilizado para transferir os dados para o aplicativo Excel.</p><p>Esta funcionalidade foi reformulada. No lugar de acessá-la pelo botão ao lado direito da tela, ela está agora disponível no menu contextual das tabelas do demonstrativo, conforme imagem a seguir.</p><p><img src="'+L+'" alt="Menu contextual tabela demonstrativo"></p><p>Para acessar o menu contextual, clique com o botão direito do mouse sobre a tabela desejada.</p><h4 id="gerar-texto" tabindex="-1">Gerar texto <a class="header-anchor" href="#gerar-texto" aria-label="Permalink to &quot;Gerar texto&quot;">​</a></h4><p><img src="'+V+'" alt="Botão Gerar Texto"></p><p>Esta opção permite exportar os dados do demonstrativo em formato de texto, separados em dois blocos:</p><ol><li>Períodos <ul><li>Tabela Tempo de Contribuição;</li><li>Períodos.</li></ul></li><li>Benefícios</li></ol><p>Esta funcionalidade foi reformulada. No lugar de acessá-la pelo botão ao lado direito da tela, ela está agora disponível diretamente nos blocos de dados a serem exportados em formato texto, conforme as imagens a seguir.</p><p><img src="'+Y+'" alt="Botões exportar tabela"></p><p><img src="'+G+'" alt="Botões exportar beneficios"></p><h3 id="configuracoes" tabindex="-1">Configurações <a class="header-anchor" href="#configuracoes" aria-label="Permalink to &quot;Configurações&quot;">​</a></h3><p><img src="'+J+'" alt="Botão configurar"></p><p>Ao clicar neste botão, o usuário pode configurar diversas opções, dividas em:</p><ol><li><a href="/docs/tc.html#opcoes-demonstrativos">Opções Demonstrativos</a></li><li><a href="/docs/tc.html#opcoes-gerar-texto">Opções Gerar Texto</a></li></ol><h3 id="opcoes-demonstrativos" tabindex="-1">Opções Demonstrativos <a class="header-anchor" href="#opcoes-demonstrativos" aria-label="Permalink to &quot;Opções Demonstrativos&quot;">​</a></h3><p>Menu com opções de configuração dos demonstrativos de cálculo:</p><ol><li><a href="/docs/tc.html#versão-compacta">Versão compacta</a></li><li><a href="/docs/tc.html#mostrar-parametros-da-contagem">Mostrar parâmetros da contagem</a></li><li><a href="/docs/tc.html#mostrar-observacoes-nas-notas">Mostrar observações nas notas</a></li><li><a href="/docs/tc.html#mostrar-faixas-de-alerta-de-inconsistencia-nos-beneficios">Mostrar faixas de alerta de inconsistência nos benefícios</a></li><li><a href="/docs/tc.html#tipo-de-cabeçalho">Tipo de cabeçalho</a></li><li><a href="/docs/tc.html#colunas-das-notas">Colunas das notas</a></li><li><a href="/docs/tc.html#qualidade-da-imagem">Qualidade da imagem</a></li><li><a href="/docs/tc.html#tamanho-da-fonte">Tamanho da fonte</a></li></ol><h4 id="versao-compacta" tabindex="-1">Versão compacta <a class="header-anchor" href="#versao-compacta" aria-label="Permalink to &quot;Versão compacta&quot;">​</a></h4><p>Opção para alterar a visualização do bloco &quot;Períodos Calculados&quot;, na qual a coluna <code>Motivo</code> é suprimida, aumentando o espaço das demais informações.</p><h4 id="mostrar-parametros-da-contagem" tabindex="-1">Mostrar parâmetros da contagem <a class="header-anchor" href="#mostrar-parametros-da-contagem" aria-label="Permalink to &quot;Mostrar parâmetros da contagem&quot;">​</a></h4><p>Opção para suprimir os <code>Parâmetros Contagem</code> utilizados na contagem no bloco <code>Informações e parâmetros gerais</code>.</p><h4 id="mostrar-observacoes-nas-notas" tabindex="-1">Mostrar observações nas notas <a class="header-anchor" href="#mostrar-observacoes-nas-notas" aria-label="Permalink to &quot;Mostrar observações nas notas&quot;">​</a></h4><p>Opção para suprimir as observações dos períodos lançados na aba <code>Períodos</code>.</p><h4 id="mostrar-faixas-de-alerta-de-inconsistencia-nos-beneficios" tabindex="-1">Mostrar faixas de alerta de inconsistência nos benefícios <a class="header-anchor" href="#mostrar-faixas-de-alerta-de-inconsistencia-nos-beneficios" aria-label="Permalink to &quot;Mostrar faixas de alerta de inconsistência nos benefícios&quot;">​</a></h4><p>Opção para suprimir o alerta de inconsitência na análise da data de implementação do benefício.</p><h4 id="tipo-de-cabecalho" tabindex="-1">Tipo de cabeçalho <a class="header-anchor" href="#tipo-de-cabecalho" aria-label="Permalink to &quot;Tipo de cabeçalho&quot;">​</a></h4><p>Possibilidade de alterar quais informações constarão no cabeçalho do demonstrativo de cálculo: <code>Nome do cálculo</code> ou <code>Dados do Processo</code>.</p><h4 id="colunas-das-notas" tabindex="-1">Colunas das notas <a class="header-anchor" href="#colunas-das-notas" aria-label="Permalink to &quot;Colunas das notas&quot;">​</a></h4><p>Possibilidade de alterar a quantidade de colunas que serão utilizadas no demonstrativo para efeito de visualização das notas.</p><h4 id="qualidade-da-imagem" tabindex="-1">Qualidade da imagem <a class="header-anchor" href="#qualidade-da-imagem" aria-label="Permalink to &quot;Qualidade da imagem&quot;">​</a></h4><p>Possibilidade de alterar a qualidade da imagem do demonstrativo gerada (apenas para opção de imagem baixada).</p><h4 id="tamanho-da-fonte" tabindex="-1">Tamanho da fonte <a class="header-anchor" href="#tamanho-da-fonte" aria-label="Permalink to &quot;Tamanho da fonte&quot;">​</a></h4><p>Opção para alterar o tamanho da fonte utilizada no demonstrativo.</p><h3 id="opcoes-gerar-texto" tabindex="-1">Opções Gerar Texto <a class="header-anchor" href="#opcoes-gerar-texto" aria-label="Permalink to &quot;Opções Gerar Texto&quot;">​</a></h3><p>Menu com opções de configuração dos textos que serão gerados a partir dos demonstrativos:</p><ol><li><p><a href="/docs/tc.html#periodos">Períodos</a></p><ul><li><a href="/docs/tc.html#formato">Formato</a></li><li><a href="/docs/tc.html#numeracao">Numeração</a></li><li><a href="/docs/tc.html#incluir">Incluir</a></li><li><a href="/docs/tc.html#filtrar-por">Filtrar por</a></li></ul></li><li><p><a href="/docs/tc.html#beneficios">Benefícios</a></p><ul><li><a href="/docs/tc.html#formato">Formato</a></li><li><a href="/docs/tc.html#numeracao">Numeração</a></li></ul></li></ol><h4 id="periodos" tabindex="-1">Períodos <a class="header-anchor" href="#periodos" aria-label="Permalink to &quot;Períodos&quot;">​</a></h4><p>Opções para configuração do texto descrito dos períodos.</p><h5 id="formato" tabindex="-1">Formato <a class="header-anchor" href="#formato" aria-label="Permalink to &quot;Formato&quot;">​</a></h5><p>É possível escolher se os períodos devem estar em linhas separadas e se devem ser numerados.</p><h5 id="numeracao" tabindex="-1">Numeração <a class="header-anchor" href="#numeracao" aria-label="Permalink to &quot;Numeração&quot;">​</a></h5><p>É habilitado no caso de ter habilitada a numeração na seção <code>Formato</code>, podendo ser escolhido o tipo de numeração (números cardinais, ordinais, romanos ou letras).</p><h5 id="incluir" tabindex="-1">Incluir <a class="header-anchor" href="#incluir" aria-label="Permalink to &quot;Incluir&quot;">​</a></h5><p>Opção de escolha dos dados que serão levados para o texto (descrição, forma contagem e motivo contagem), além das datas inicial e final.</p><h5 id="filtrar-por" tabindex="-1">Filtrar por <a class="header-anchor" href="#filtrar-por" aria-label="Permalink to &quot;Filtrar por&quot;">​</a></h5><p>Possibilidade de filtrar os períodos que serão levados para o texto com base no <code>Motivo Contagem</code>.</p><h4 id="beneficios-1" tabindex="-1">Benefícios <a class="header-anchor" href="#beneficios-1" aria-label="Permalink to &quot;Benefícios&quot;">​</a></h4><p>É possível escolher se os benefícios analisados devem estar em linhas sepadas e se devem ser numerados.</p><h5 id="formato-1" tabindex="-1">Formato <a class="header-anchor" href="#formato-1" aria-label="Permalink to &quot;Formato&quot;">​</a></h5><p>É possível escolher se as análises dos requisitos dos benefícios devem estar em linhas separadas e se devem ser numerados.</p><h5 id="numeracao-1" tabindex="-1">Numeração <a class="header-anchor" href="#numeracao-1" aria-label="Permalink to &quot;Numeração&quot;">​</a></h5><p>É habilitado no caso de ter habilitada a numeração na seção <code>Formato</code>, podendo ser escolhido o tipo de numeração (números cardinais, ordinais, romanos ou letras).</p><hr><h2 id="opcoes-salvar-abrir-e-novo" tabindex="-1">Opções <code>Salvar</code>, <code>Abrir</code> e <code>Novo</code> <a class="header-anchor" href="#opcoes-salvar-abrir-e-novo" aria-label="Permalink to &quot;Opções `Salvar`, `Abrir` e `Novo`&quot;">​</a></h2><p><img src="'+v+'" alt="Botões salvar, abrir e novo"> No canto superior direito da ferramenta, temos 3 botões:</p><ol><li><a href="/docs/tc.html#salvar">Salvar</a>;</li><li><a href="/docs/tc.html#abrir">Abrir</a>;</li><li><a href="/docs/tc.html#novo">Novo</a>.</li></ol><h3 id="salvar" tabindex="-1">Salvar <a class="header-anchor" href="#salvar" aria-label="Permalink to &quot;Salvar&quot;">​</a></h3><p>Clicando no botão <code>Salvar</code>, é baixado um arquivo <code>.calc</code> no computador, contendo todos os dados do cálculo efetuado, possibilitando sua recuperação posteriormente.</p><h3 id="abrir" tabindex="-1">Abrir <a class="header-anchor" href="#abrir" aria-label="Permalink to &quot;Abrir&quot;">​</a></h3><p>Clicando no botão <code>Abrir</code>, será aberta uma caixa de texto, em que é possível selecionar um arquivo <code>.calc</code> salvo anteriormente. Dessa forma, o cálculo será recuperado e aberto na ferramenta.</p><h3 id="novo" tabindex="-1">Novo <a class="header-anchor" href="#novo" aria-label="Permalink to &quot;Novo&quot;">​</a></h3><p>Clicar no botão <code>Novo</code>, surgirá a seguinte mensagem: <img src="'+b+'" alt="Mensagem novo cálculo" width="70%"> Clicando em <code>Confirmar</code>, todos os dados inseridos serão apagados.</p><div class="tip custom-block"><p class="custom-block-title">💡 DICA</p><p>Ao iniciar um cálculo novo, é altamente recomendável que seja utilizado o botão <code>Novo</code>, garantindo que os dados de outro cálculo não sejam utilizados incorretamente.</p></div><div class="tip custom-block"><p class="custom-block-title">❗ IMPORTANTE</p><p>Quando o navegador é fechado por algum motivo (desligamento do computador, por exemplo) e a página da ferramenta for novamente acessada, surgirá uma mensagem referente à existência de dados carregados, sendo possível continuar um cálculo que estava sendo realizado anteriormente. Outra opção é escolher a opção <code>Novo Cálculo</code>, que possui comportamento semelhante ao botão <code>Novo</code></p></div><h2 id="botao-apagar-todos-os-dados-da-fabrica-de-calculos-do-navegador" tabindex="-1">Botão apagar todos os dados da Fábrica de Cálculos do navegador <a class="header-anchor" href="#botao-apagar-todos-os-dados-da-fabrica-de-calculos-do-navegador" aria-label="Permalink to &quot;Botão apagar todos os dados da Fábrica de Cálculos do navegador&quot;">​</a></h2><p><img src="'+f+'" alt="Botão limpar dados Fábrica"></p><p>Clique neste botão para apagar todos os dados da Fábrica de Cálculos salvos no navegador (abrangendo todas as ferramentas). Caso esteja enfrentando problemas na utilização, utilize esta opção para verificar se o erro é corrigido.</p><h2 id="menu" tabindex="-1">Menu <a class="header-anchor" href="#menu" aria-label="Permalink to &quot;Menu&quot;">​</a></h2><p><img src="'+A+'" alt="Botão Menu"></p><p>No menu localizado no canto superior direito, temos as seguintes opções:</p><ol><li><a href="/docs/tc.html#tutoriais-e-ajuda">Tutoriais e ajuda</a>;</li><li><a href="/docs/tc.html#problemas-e-sugestoes">Problemas e sugestões</a>;</li><li><a href="/docs/tc.html#fabrica-de-calculos">Fábrica de Cálculos</a>.</li></ol><h3 id="tutoriais-e-ajuda" tabindex="-1">Tutoriais e ajuda <a class="header-anchor" href="#tutoriais-e-ajuda" aria-label="Permalink to &quot;Tutoriais e ajuda&quot;">​</a></h3><p>Clicando nesta opção, o usuário será redirecionado para este site, com informações e tutoriais para utilização das ferramentas de cálculo.</p><h3 id="problemas-e-sugestoes" tabindex="-1">Problemas e sugestões <a class="header-anchor" href="#problemas-e-sugestoes" aria-label="Permalink to &quot;Problemas e sugestões&quot;">​</a></h3><p>Nesta opção, o usuário tem acesso a um formulário, que pode ser utilizado para reportar problemas, bem como dar sugestões referentes às ferramentas.</p><h3 id="fabrica-de-calculos" tabindex="-1">Fábrica de Cálculos <a class="header-anchor" href="#fabrica-de-calculos" aria-label="Permalink to &quot;Fábrica de Cálculos&quot;">​</a></h3><p>Link para o <a href="https://www.trf3.jus.br/fabrica-de-calculos" target="_blank" rel="noreferrer"><strong>Portal da Fábrica de Cálculos</strong></a>.</p>',342)]))}const ca=q(K,[["render",W]]);export{ta as __pageData,ca as default};
